B.bv={myth:0,truth:1,category:2}
B.Qq=new A.aT(B.bv,["\u274c Spot reduction works - I can lose belly fat by doing crunches","\u2705 You cannot choose where you lose fat. Your body decides based on genetics. Do full-body workouts + maintain calorie deficit for overall fat loss.","fat_loss"],t.l)
B.Qs=new A.aT(B.bv,["\u274c Sweating more = more fat burned","\u2705 Sweat is just water loss for body cooling. You burn calories through movement and muscle work, not sweating. You can burn lots of calories without sweating much.","exercise"],t.l)
B.Qt=new A.aT(B.bv,["\u274c Carbs make you fat","\u2705 EXCESS calories make you fat, not carbs specifically. Ugali, rice, and chapati are fine in proper portions. It's about total calories, not avoiding carbs.","nutrition"],t.l)
B.Qx=new A.aT(B.bv,["\u274c Women get bulky from lifting weights","\u2705 Women have 15-20x less testosterone than men - very hard to get bulky. Strength training builds lean, toned muscles and boosts metabolism.","exercise"],t.l)
B.Qw=new A.aT(B.bv,["\u274c Eating late at night causes weight gain","\u2705 Total daily calories matter, not timing. Eating 1,500 calories at 6pm vs 10pm makes no difference. Focus on what and how much you eat, not when.","nutrition"],t.l)
B.Qr=new A.aT(B.bv,["\u274c You must exercise daily to lose weight","\u2705 Weight loss is 70% diet, 30% exercise. Three 20-minute workouts per week + healthy eating works better than daily exercise with poor diet.","exercise"],t.l)
B.Qy=new A.aT(B.bv,["\u274c Skipping meals helps you lose weight faster","\u2705 Skipping meals slows metabolism and makes you overeat later. Eat regular, balanced meals to keep metabolism active and control hunger.","nutrition"],t.l)
B.Qo=new A.aT(B.bv,["\u274c Muscle turns into fat when you stop exercising","\u2705 Muscle and fat are different tissues. Muscle cannot become fat. When you stop exercising, you lose muscle AND may gain fat if you overeat.","exercise"],t.l)
B.Qn=new A.aT(B.bv,["\u274c You need expensive gym equipment to get fit","\u2705 Bodyweight exercises (push-ups, squats, lunges) are highly effective. Your body is the best equipment. Consistency beats fancy equipment.","exercise"],t.l)
B.Qm=new A.aT(B.bv,["\u274c Fat-free foods are always healthier",'\u2705 Fat-free often means more sugar and chemicals. Healthy fats (avocado, groundnuts) are essential. Focus on whole foods, not "fat-free" labels.',"nutrition"],t.l)
B.Qk=new A.aT(B.bv,["\u274c Detox teas/juices cleanse your body",'\u2705 Your liver and kidneys naturally detox your body 24/7. "Detox" products are marketing scams. Drink water, eat vegetables, sleep well.',"nutrition"],t.l)
B.Ql=new A.aT(B.bv,['\u274c You can "target" lose weight in one area',"\u2705 Fat loss happens all over your body. Genetics determine where fat comes off first. Do full-body exercise and be patient.","fat_loss"],t.l)
B.Qv=new A.aT(B.bv,["\u274c The scale is the best measure of progress","\u2705 Muscle weighs more than fat. You can lose fat, gain muscle, and weigh the same. Take measurements, photos, and track how clothes fit.","progress"],t.l)
B.Qp=new A.aT(B.bv,["\u274c Cardio is better than strength training for weight loss","\u2705 Strength training builds muscle, which burns calories even at rest. Combine both: cardio burns calories now, muscle burns calories 24/7.","exercise"],t.l)
B.Qu=new A.aT(B.bv,["\u274c You must feel sore after every workout","\u2705 Soreness just means your muscles aren't used to that exercise. No soreness doesn't mean no progress. Consistency and progressive challenge matter most.","exercise"],t.l)
